/**
 * client/src/components/Navbar.js
 * AI-generated navbar. Human-read notes: make links conditional based on auth state and improve mobile layout.
 */
import React from 'react';
import { Link } from 'react-router-dom';

const styles = {
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '12px 20px',
    backgroundColor: '#939699ff',
    color: 'white'
  },
  brand: {
    fontWeight: 'bold',
    fontSize: '18px'
  },
  navLinks: {
    display: 'flex',
    gap: '12px'
  },
  link: {
    color: 'white',
    textDecoration: 'none'
  }
};

export default function Navbar() {
  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location = '/';
  };

  return (
    <header className="site-header">
      <div className="brand">Job Portal</div>
      <nav className="nav-links">
        <Link className="nav-link" to="/dashboard">Dashboard</Link>
        <Link className="nav-link" to="/analysis">Analysis</Link>
        <Link className="nav-link" to="/profile">Profile</Link>
        <button onClick={handleLogout} className="btn secondary">Logout</button>
      </nav>
    </header>
  );
}
